pragma solidity >=0.4.0 <0.6.0;

import "./libToken.sol";

library ExchangeStruct {
    ///////////////////////
    // GENERAL STRUCTURE //
    ///////////////////////
    struct Offer {
    uint amount;
    address who;
    }

    struct OrderBook {

    uint higherPrice;
    uint lowerPrice;

    mapping (uint => Offer) offers;

    uint offers_key;
    uint offers_length;
    }

    struct Token {
    libToken tokenContract;
    string symbolName;


    mapping (uint => OrderBook) buyBook;

    uint curBuyPrice;
    uint lowestBuyPrice;
    uint amountBuyPrices;


    mapping (uint => OrderBook) sellBook;
    uint curSellPrice;
    uint highestSellPrice;
    uint amountSellPrices;

    }


    //we support a max of 255 tokens...
    struct DataToken {
        mapping (uint8 => Token) tokens;
        uint8 tokenIndex;
        //////////////
        // BALANCES //
        //////////////
        mapping (address => mapping (uint8 => uint)) tokenBalanceForAddress;
        mapping (address => uint) ethBalanceForAddress;
    }


}
